import React from 'react';

const StudentList = ({ title, count }) => {
  return (
    <div style={{
      backgroundColor: '#0056b3', // Pure Blue
      color: 'white',
      padding: '25px',
      borderRadius: '12px',
      minWidth: '220px',
      marginRight: '20px',
      boxShadow: '0 4px 10px rgba(0,0,0,0.1)'
    }}>
      <p style={{ margin: 0, fontSize: '15px' }}>{title}</p>
      <h1 style={{ margin: '10px 0 0 0', fontSize: '42px' }}>{count}</h1>
    </div>
  );
};

export default StudentList;
